import "./App.css";
import "./index.css";
import React from 'react';
import { BrowserRouter as Router, Route, Routes } from "react-router-dom";

function App() {
  return (
    <>
    <Router>
      <h1>I am Rehman</h1>
      <Routes>
        <Route path="/"  />
      </Routes>
    </Router>
    </>
  );
}

export default App;
